import React from "react";
import simple from './assets/simple.json'
import Card from "./components/Card";

export const Discover = () => {
  return (
    <>
      <div>
        <h3>Latest & Trending</h3>
        <div>
          {simple &&
            simple.map((movie,index) => (
              <Card movie={movie}/>
            ))}
        </div>
      </div>
    </>
  );
};
